import React, {Component} from 'react';
import Header from './components/Header';
import MainVideo from './components/MainVideo';
import NextVideo from './components/NextVideo';

import logo from './assets/Logo/Logo-brainflix.png';
import uploadIcon from './assets/Icons/PNG/Icon-upload.png';
import viewsIcon from './assets/Icons/PNG/Icon-views.png';

import './style/App.css';

class App extends Component {

  render() {
    return (
      <div className="app">
        <Header logo={logo} uploadIcon={uploadIcon} avatar="./images/Mohan-muruge.jpg" />
        <MainVideo 
          viewsIcon={viewsIcon} 
          likesIcon={likesIcon} 
          avatar="./images/Mohan-muruge.jpg" 
          commentsAvatar="./images/sloth-5043323_1920.png"
        />
        <NextVideo />
      </div>
    );
  }
}

export default App;
